当两个对象相互关联时
人对象中有 1 个车
车对象中有 1 个人
如果这两个 @property 都使用 retain，就会出现泄漏
解决方案: 1 端 retain，1 端 assign，使用 assign 的那端不再需要在 dealloc 中 release 了

