理解方式
当 CPU 开始执行某线程上的代码时:

执行到async函数代码块时，会"直接跳过"函数参数Queue中的任务(代码块)[其实是开了另外的线程去执行Queue中的任务]，直接执行后面的代码。

执行到sync函数代码块时，当前线程会等待函数参数Queue中所有任务(代码块)执行完毕，才继续执行后面的代码

而Queue中的所有任务(代码块)，会根据Queue种类不同有不同的执行方式:

